const Account = () => {
  return (
    <Layout>
      <>
        <div className="container">
          <h1 className="page-title">Your Orders</h1>
          <OrderList />
        </div>
        <style jsx>{`
          .container {
            max-width: 1200px;
            margin: 2rem auto;
          }
          .page-title {
            font-size: 3rem;
          }
        `}</style>
      </>
    </Layout>
  );
};

export default Account;
